THE ALEX JONES SHOW
Tuesday March 03, 2009

HR 1: News, commentary, economy and housing situation
HR 2: News, plugs Obama Deception, Mike Rivero, Brzezinski clip
HR 3: Richard C. Cook
HR 4: Open lines w/Cook, Paul Ingram, Dan Itse

Alex further covers the states' rights and Tenth Amendment issue with New Hampshire Rep. Daniel Itse and Paul Ingram, Republican Party Chairman of Thurston County, Washington. Alex also talks about the latest news with regular guest Mike  Rivero, publisher of the popular website WRH and GCN radio host. Finally, Alex welcomes back to the program author, consultant, and former U.S. federal government analyst who in 1986 became one of the foremost whistleblowers of modern times, Richard C. Cook. 


